import React from "react";
import { useHistory } from "react-router-dom";
import { Col, Menu, Row, Typography } from "antd";
import "./navbar.scss";

const { Title } = Typography;
function Navbar() {
  const history = useHistory();

  const handleClick = (e) => {
    if (e.key === "anime" || e.key === "shows" || e.key === "movies") {
      history.push("/" + e.key + "/browse");
    } else if (e.key !== "mylists" && e.key !== "home") {
      history.push("/auth/" + e.key);
    } else {
      history.push("/");
    }
  };

  return (
    <nav>
      <Col span={21}>
        <Menu onClick={handleClick} mode="horizontal" className="navbar">
          <Menu.Item className="left" key="home">
            <Title level={4}>MyShowLists</Title>
          </Menu.Item>
          <Menu.Item key="shows">TV</Menu.Item>
          <Menu.Item key="movies">Movies</Menu.Item>
          <Menu.Item key="discover">Discover</Menu.Item>
          <Menu.Item key="lists">My Lists</Menu.Item>
        </Menu>
      </Col>
      <Col span={3}>
        <Menu onClick={handleClick} mode="horizontal" className="navbar">
          <Menu.Item key="signup">Sign Up</Menu.Item>
          <Menu.Item key="signin">Sign In</Menu.Item>
        </Menu>
      </Col>
    </nav>
  );
}

export default Navbar;
